import React, { useState } from "react";
import Hello from "./module";
import Card from "./Card";
import Temp from "./Temp";
import OnTypeEx from "./OnTypeEx";

const App = () => {
   const [number, setNumber] = useState(100);
   const [data, setData] = useState([]);
   const stateChange = () => {
      if (number == 200) {
         setNumber(100);
      } else {
         let tempNum = number + 1;
         setNumber(tempNum);
      }
   };

   fetch("http://localhost:8080/api/thisinhs")
      .then((res) => res.json)
      .then((res) => {
         setData((previous) => {
            return [...previous, res];
         });
         console.log(res);
      });

   return (
      <div>
         <Temp>
            <Card number1={number} number2={number} function1={stateChange}></Card>
            <Hello item="hello"></Hello>
            <span className="item-align">
               <button onClick={stateChange}>Click</button>
            </span>
         </Temp>
         <OnTypeEx></OnTypeEx>
         <Temp className="temp_display">
            {data.map((data) => (
               <p>{data.maThiSinh}</p>
            ))}
         </Temp>
      </div>
   );
};

export default App;
